actionConfiguration.body:
() => {
		updateOrder.run(
			() => {
				showAlert('Removed', 'success');
				getOrder.run();
			},
			(err) => {
				showAlert(err, 'error');
				console.log(err);
			},
			{
				order: {
					...getOrder.data.order,
					item: getOrder.data.order.item.filter((i) => !_.isEqual(i, OrderItems.triggeredRow)),
				}
			}
		)
	}

